import Products from "./components/ProductsRender";
import Cart from "./components/Cart";
import GlobalStyle from "../styles/global";

function App() {
  return (
    <>
      <GlobalStyle/>
      <div className="App">
          <div>
            <Products />
            <Cart />
          </div>
      </div>
    </>
  );
}

export default App;
